import React from "react";

const Services = () => {
  return (
    <div className="container-fluid d-flex justify-content-center align-items-center services-container-desktop">
      <div className="service-card">
        <h2>Logo Design</h2>
      </div>
      <div className="service-card">
        <h2>
          Logo Design & <br />
          Brand Strategy
        </h2>
      </div>
    </div>
  );
};

export default Services;
